import React from "react";
import classes from "./Hamburger.module.scss";
const Hamburger = (props) => {
  return (
    <div
      className={classes.hamburger}
      oClick={() => {
        props.setOpen(true);
      }}
    >
      <div className={classes.burger} />
      <div className={classes.burger} />
      <div className={classes.burger} />
    </div>
  );
};

export default Hamburger;
